insert into BOOK
values
(1,6,'The Pragmatic Programmer', 'Andy Hunt', 'Ward Cunningham Straight from the programming trenches, The Pragmatic Programmer cuts through the increasing specialization and technicalities of modern software development to examine the core process--taking a requirement and producing working, maintainable code that delights its users. It covers topics ranging from personal responsibility and career development to architectural techniques for keeping your code flexible and easy to adapt and reuse. Read this book, and you will learn how to *Fight software rot; *Avoid the trap of duplicating knowledge; *Write flexible, dynamic, and adaptable code; *Avoid programming by coincidence; *Bullet-proof your code with contracts, assertions, and exceptions; *Capture real requirements; *Test ruthlessly and effectively; *Delight your users; *Build teams of pragmatic programmers; and *Make your developments more precise with automation. Written as a series of self-contained sections and filled with entertaining anecdotes, thoughtful examples, and interesting analogies, The Pragmatic Programmer illustrates the best practices and major pitfalls of many different aspects of software development. Whether you are a new coder, an experienced program', '1999/10/2', 'Addison Wesley', 'the-pragmatic-programmer.jpg', 'N'),
(2,6,'The Clean Coder: A Code of Conduct for Professional Programmers', 'Robert Martin', 'Programmers who endure and succeed amidst swirling uncertainty and nonstop pressure share a common attribute: They care deeply about the practice of creating software. They treat it as a craft. They are professionals. In The Clean Coder: A Code of Conduct for Professional Programmers, legendary software expert Robert C. Martin introduces the disciplines, techniques, tools, and practices of true software craftsmanship. This book is packed with practical advice-about everything from estimating and coding to refactoring and testing. It covers much more than technique: It is about attitude. Martin shows how to approach software development with honor, self-respect, and pride, work well and work clean, communicate and estimate faithfully, face difficult decisions with clarity and honesty; and understand that deep knowledge comes with a responsibility to act. Readers will learn What it means to behave as a true software craftsman How to deal with conflict, tight schedules, and unreasonable managers How to get into the flow of coding, and get past writers block How to handle unrelenting pressure and avoid burnout How to combine enduring attitudes with new development paradigms How to manage your time, and avoid blind alleys, marshes, bogs, and swamps How to foster environments where programmers and teams can thrive When to say "No"-and how to say it When to say "Yes"-and what yes really means Great software is something to marvel at: powerful, elegant, functional, a pleasure to work with as both a developer and as a user. Great software is not written by machines. It is written by professionals with an unshakable commitment to craftsmanship. The Clean Coder will help you become one of them-and earn the pride and fulfillment that they alone possess', '2011/5/4', 'Addison Wesley', 'The clean coder.jpg', 'N'),
(3,6,N'HACKER LƯỢC SỬ', 'Steven Levy', N'Cuốn sách nói về những nhân vật, cỗ máy, sự kiện định hình cho văn hóa và đạo đức hacker từ những hacker đời đầu ở đại học MIT. Câu chuyện hấp dẫn bắt đầu từ các phòng thí nghiệm nghiên cứu máy tính đầu tiên đến các máy tính gia đình. Tập hợp tài liệu cập nhật từ các tin tặc nổi tiếng như Bill Gates, Mark Zuckerberg, Richard Stallman,..Những sự thật về cuộc sống và con đường trở thành “tin tặc” của những con người đã thay đổi lịch sử phát triển của ngành Công nghệ. Cuốn sách của Steven Levy ghi lại những chiến công của các tin tặc thời kỳ đầu trong cuộc cách mạng máy tính - những kẻ mê máy tính thông minh và lập dị từ cuối những năm 1950 đến đầu thập niên 1980, dám mạo hiểm, bẻ cong quy tắc và đẩy thế giới vào một hướng đi hoàn toàn mới.',  '2015/09/15', 'Addison Wesley', 'hacker-luoc-su.jpg', 'N'),
(4,6,'CLEAN CODE', 'Robert Martin', 'Even bad code can function. But if code isn’t clean, it can bring a development organization to its knees. Every year, countless hours and significant resources are lost because of poorly written code. But it doesn’t have to be that way. Noted software expert Robert C. Martin presents a revolutionary paradigm with Clean Code: A Handbook of Agile Software Craftsmanship . Martin has teamed up with his colleagues from Object Mentor to distill their best agile practice of cleaning code “on the fly” into a book that will instill within you the values of a software craftsman and make you a better programmer—but only if you work at it. What kind of work will you be doing? You’ll be reading code—lots of code. And you will be challenged to think about what’s right about that code, and what’s wrong with it. More importantly, you will be challenged to reassess your professional values and your commitment to your craft', '2008/8/1', 'Addison Wesley', 'clean-code.jpg', 'N'),
(5,2,'Oxford School Dictionary', 'Oxford', N'Một ấn bản mới chính của Từ điển Trường học Oxford toàn diện, đáng tin cậy, bán chạy nhất với hỗ trợ chương trình học mới. Ấn bản mới tuyệt vời này sẽ nâng cao vốn từ vựng của con bạn với những từ và nghĩa mới từ khắp chương trình học. Phần chính tả, ngữ pháp và dấu câu mới hữu ích được bao gồm để nâng cao kỹ năng ngôn ngữ và cập nhật từ điển', '2016/09/12', 'Oxford School', 'Oxford-School-Dictionary.jpg', 'N'),
(6,2,'Oxford Advanced Learners Dictionary 8th with Vietnamese Translation (PB)', 'Oxford', 'Từ điển Anh – Anh – Việt dựa trên ấn bản OALD, được Viện Ngôn ngữ học thẩm định nội dung. Một trong những cuốn từ điển được bán chạy nhất mọi thời đại và được phát triển từ 1948 với hơn 100 triệu người đang sử dụng.',  '1980/10/10', 'Oxford School', 'Oxford-Advanced-Learner-.jpg', 'N'),
(7,2,'English Grammar in Use Book w Ans', 'Raymond Murphy', 'The worlds best-selling grammar series for learners of English. English Grammar in Use Fourth edition is an updated version of the worlds best-selling grammar title. It has a fresh, appealing new design and clear layout, with revised and updated examples, but retains all the key features of clarity and accessibility that have made the book popular with millions of learners and teachers around the world. This "with answers" version is ideal for self-study. An online version, book without answers, and book with answers and CD-ROM are available separately.',  '2017/4/5', 'Cambridge', 'English-Grammar-in-Use.jpg', 'N'),
(8,2,N'Marugoto - Ngôn Ngữ Và Văn Hóa Nhật Bản: Trung Cấp 1 - B1', 'Japan Foundation', N'“Marugoto - Ngôn ngữ và Văn hóa Nhật Bản” chính là bộ giáo trình đáp ứng hoàn hảo nhu cầu trên. Tựa đề Marugoto trong tiếng Nhật có nghĩa là “trọn vẹn”, chứa đựng thông điệp mà những người thực hiện muốn gửi gắm: Một bộ giáo trình học tiếng Nhật toàn diện, kết hợp giữa yếu tố ngôn ngữ và văn hóa, giữa kiến thức và thực hành thực tế. Với Marugoto, người học hướng đến việc sử dụng tiếng Nhật một cách “trọn vẹn”: Trọn vẹn trong giao tiếp chân thực giữa người với người, trọn vẹn trong trải nghiệm ngôn ngữ cùng đời sống và văn hóa.',  '2021/3/15', N'NXB Đại Học Quốc Gia TP.HCM', 'Marugoto-B1.png', 'N'),
(9,2,N'Giáo trình Marugoto A1 - Hiểu biết ngôn ngữ văn hóa Nhật', 'Japan Foundation', N'Marugoto Rikai - Ngôn ngữ và văn hóa Nhật Bản - Hiểu biết ngôn ngữ. Marugoto có nghĩa là Trọn vẹn, chứa đựng thông điệp về sự hài hòa giữ ngôn ngữ và văn hóa. giáo trình giới thiệu những tình huống giao tiếp thực tế, giúp người học trải nghiệm nhiều khía cạnh đa dạng của văn hóa Nhật Bản và đặc trưng trong đời sống của người Nhật một cách trọn vẹn.', '2018/8/29', N'NXB Đại Học Quốc Gia TP.HCM', 'Marugoto-A1.jpg', 'N'),
(10,2,N'7000 Từ Vựng Tiếng Nhật Theo Chủ Đề', 'Huy Khang', N'Quyển sách “7000 từ vựng tiếng Nhật theo chủ đề” phân loại từ vựng theo 145 chủ đề, giới thiệu các bài học được nghiên cứu cẩn thận nhằm phát triển vốn từ vựng của học viên qua các chủ đề khác nhau. Bắt đầu qua các chủ đề thông dụng rồi dần dần mở rộng qua các chủ đề rộng lớn, bao quát thế giới xung quanh. Các bài học đầu tiên về gia đình, nhà ở, các hoạt động về cộng đồng, trường học, nơi làm việc, mua sắm, giải trí và các chủ đề thông dụng khác.', '2020-12-01', N'NXB Thanh Niên','7000-tu-vung-Tieng-Nhat.jpg', 'N')
